import os
import pandas as pd
from flask import Flask, render_template, request, redirect, url_for
from werkzeug.utils import secure_filename

app = Flask(__name__)

# Initialize database connection
def init_db():
    db = {}
    db['FABS'] = []
    db['GTAS'] = []
    db['DABS'] = []
    return db

db = init_db()

# Update FABS submissions
def update_fabs_submissions(data):
    db['FABS'].append(data)
    return "FABS submission updated successfully"

# Add GTAS window data
def add_gtas_data(data):
    db['GTAS'].append(data)
    return "GTAS data added successfully"

# Update FABS sample files
def update_fabs_sample_files(file_path):
    if os.path.exists(file_path):
        with open(file_path, 'r') as file:
            data = file.read()
            db['FABS'].append(data)
            return "FABS sample file updated successfully"
    else:
        return "File not found"

# Access published FABS files
def access_published_fabs_files():
    return db['FABS']

# View FABS pages
@app.route('/fabs')
def view_fabs_pages():
    return render_template('fabs.html')

# Navigate to FABS or DABS pages
@app.route('/navigate')
def navigate_to_pages():
    page = request.args.get('page')
    if page == 'fabs':
        return redirect(url_for('view_fabs_pages'))
    elif page == 'dabs':
        return render_template('dabs.html')
    else:
        return "Invalid page"

# Access raw agency published files
def access_raw_agency_files():
    files = os.listdir('agency_files')
    return files

# View updated financial assistance data
def view_updated_fabs_data():
    return db['FABS']

# Generate D files from FABS and FPDS data
def generate_d_files(fabs_data, fpds_data):
    # Generate D file content
    d_file_content = "D File Content"
    # Save D file to disk
    with open('d_file.txt', 'w') as file:
        file.write(d_file_content)
    return "D file generated successfully"

# Prevent duplicate transactions
def prevent_duplicate_transactions(transaction):
    if transaction not in db['FABS']:
        db['FABS'].append(transaction)
        return "Transaction added successfully"
    else:
        return "Duplicate transaction detected"

# Test functions
@app.route('/test_update_fabs_submissions', methods=['POST'])
def test_update_fabs_submissions():
    data = request.get_json()
    return update_fabs_submissions(data)

@app.route('/test_add_gtas_data', methods=['POST'])
def test_add_gtas_data():
    data = request.get_json()
    return add_gtas_data(data)

@app.route('/test_update_fabs_sample_files', methods=['POST'])
def test_update_fabs_sample_files():
    file_path = request.get_json()['file_path']
    return update_fabs_sample_files(file_path)

@app.route('/test_access_published_fabs_files')
def test_access_published_fabs_files():
    return str(access_published_fabs_files())

@app.route('/test_view_fabs_pages')
def test_view_fabs_pages():
    return view_fabs_pages()

@app.route('/test_navigate_to_pages')
def test_navigate_to_pages():
    return navigate_to_pages()

@app.route('/test_access_raw_agency_files')
def test_access_raw_agency_files():
    return str(access_raw_agency_files())

@app.route('/test_view_updated_fabs_data')
def test_view_updated_fabs_data():
    return str(view_updated_fabs_data())

